import React, { Component } from "react";
import List from "@material-ui/core/List";
import { withStyles } from "@material-ui/core/styles";
import Divider from "@material-ui/core/Divider";

import Command from "./Command";

const styles = theme => ({
  root: {
    flexGrow: 1,
    maxWidth: 752
  },
  demo: {
    backgroundColor: theme.palette.background.paper
  },
  title: {
    margin: `${theme.spacing.unit * 4}px 0 ${theme.spacing.unit * 2}px`
  }
});

class CommandList extends Component {
  state = {
    dense: false,
    secondary: false,
    commands: [
      { command: "Shut the fuck up Sparky", action: "move" },
      { command: "Sparky you're a peice of shit", action: "move" },
      {
        command:
          "Even though I verbally abuse you, you're still my best friend Sparky, don't leave me",
        action: "priority"
      }
    ]
  };

  getCommands() {
    return this.state.commands;
  }
  render() {
    return (
      <Paper className={classes.root}>
        <Table className={classes.table}>
          <TableHead>
            <TableRow>
              <TableCell>Dessert (100g serving)</TableCell>
              <TableCell align="right">Calories</TableCell>
              <TableCell align="right">Fat (g)</TableCell>
              <TableCell align="right">Carbs (g)</TableCell>
              <TableCell align="right">Protein (g)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map(row => (
              <TableRow key={row.id}>
                <TableCell component="th" scope="row">
                  {row.name}
                </TableCell>
                <TableCell align="right">{row.calories}</TableCell>
                <TableCell align="right">{row.fat}</TableCell>
                <TableCell align="right">{row.carbs}</TableCell>
                <TableCell align="right">{row.protein}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
      /*
      <List style={{ padding: 24 }} dense={this.state.dense}>
        {this.state.commands.map(command => (
          <div>
            <Command action={command.action} data={command.command} />
            <li>
              <Divider variant="inset" />
            </li>
          </div>
        ))}
      </List>

      */
    );
  }
}
export default withStyles(styles)(CommandList);
